function firstSundayOfMonth(year, month) {
    const firstDay = new Date(year, month - 1, 1); // Month is 0-based in JavaScript
    const dayOfWeek = firstDay.getDay();
    const daysUntilSunday = (7 - dayOfWeek) % 7;
    firstDay.setDate(firstDay.getDate() + daysUntilSunday);
    console.log(`First Sunday of ${year}-${month}: ${firstDay.toISOString()}`);  // Debugging
    return firstDay;
}

function collectExpensesToFirstSunday(expenses, year, month, firstSunday) {
    let allExpenses = [];
    for (const day in expenses[month]) {
        const dayDate = new Date(year, month - 1, Number(day));  // Convert day string to date
        console.log(`Checking day: ${dayDate.toISOString()}, firstSunday: ${firstSunday.toISOString()}`);
        if (dayDate <= firstSunday) {
            for (const category in expenses[month][day]) {
                allExpenses.push(...expenses[month][day][category]);
            }
        }
    }
    console.log(`Collected expenses for ${year}-${month}: ${allExpenses}`);  // Debugging
    return allExpenses;
}

function solution1(expenses) {
    const result = {};
    for (const month in expenses) {
        const [year, monthNum] = month.split('-').map(Number);
        const firstSunday = firstSundayOfMonth(year, monthNum);  // Get first Sunday of the month
        const allExpenses = collectExpensesToFirstSunday(expenses, year, month, firstSunday);

        console.log(`All expenses for ${month}: ${allExpenses}`);  // Debugging

        allExpenses.sort((a, b) => a - b);  // Sort expenses
        const n = allExpenses.length;
        result[month] = (n === 0)
            ? null
            : (n % 2 === 1)
                ? allExpenses[Math.floor(n / 2)]
                : (allExpenses[n / 2 - 1] + allExpenses[n / 2]) / 2;
    }
    return result;
}

const expenses = {
    "2023-01": {
        "01": {
            "food": [22.11, 43, 11.72, 2.2, 36.29, 2.5, 19],
            "fuel": [210.22]
        },
        "09": {
            "food": [11.9],
            "fuel": [190.22]
        }
    },
    "2023-03": {
        "07": {
            "food": [20, 11.9, 30.20, 11.9]
        },
        "04": {
            "food": [10.20, 11.50, 2.5],
            "fuel": []
        }
    },
    "2023-04": {}
};

console.log(solution1(expenses));  // Run the solution function
